import React from 'react';

const Table = ({ customers, loading, currentPage }) => {
  if (loading) {
    return <div>Loading...</div>;
  }

console.log(customers)
  return (
    
  
    <table className = 'table table-hover w-75 mx-auto text-start'>
      <thead className='table-primary'> 
        <tr>
          <th>S.No</th>
          <th>Customer_sno</th>
          <th>Customer Name</th>
          <th>Age</th>
          <th>Phone</th>
          <th>Location</th>
          <th>Date</th>
          <th>Time</th>
        </tr>
      </thead>
      <tbody className='table-group-divider'>
        {customers.map((customer, index) => (
          <tr key={customer.sno}>
            <th scope='row'>{index + 1 + (20*(currentPage-1))}</th>
            <td>{customer.sno}</td>
            <td>{customer.customer_name}</td>
            <td>{customer.age}</td>
            <td>{customer.phone}</td>
            <td>{customer.location}</td>
            <td>{customer.created_at.split('T')[0]}</td>
            <td>{customer.created_at.split('T')[1]}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default Table;
